content:
São TRÊS CLASSES que formam a população e a “vida” da nação brasileira: 
 A 1ª são OS POLITICOS engravatados e blindados pelas forças armadas, que se exibem e sobrevoam  por cima, manipulando suas leis, para  manterem  seus privilégios  na classe rica, assentados nas câmaras e nos palácios, comandando e governando;
 A 2ª são OS BANDIDOS livres. procurando e tomando dinheiro, ocultos e presentes armados e mascarados que atacam por baixo roubando e matando,  assentados nas favelas, nas prisões. e na violência conquistando manipulando e aterrorizando o povo;
E a 3ª é O PÕVO que fica  no meio trabalhando ou se virando para sobreviver e conviver, dentro da desorganização, apavorados e cercados e dominados pelos ladrões e explorados e enganados, servindo de apoio para os políticos.

Artigo 7º - Os valores fundamentais, determinantes da moral policial-militar, são os seguintes:
I - o PATRIOTISMO;
II - o civismo;
III - a hierarquia;
IV - a DISCIPLINA;
V - o profissionalismo;
VI - a lealdade;
VII - a constância;
VIII - a verdade real;
IX - a honra;
X - a dignidade humana;
XI - a HONESTIDADE;
XII - a coragem.
Sr. Governador Geraldo Alckmin, faça-os cumpri-los.
